import React, { Component } from 'react';
import Logo from './img/logo.png';
import './App.css';

export class Header extends Component {
	render() {
		return (
			<div className="Header">
				<div className="nav">
					<div className="logo">
						
					</div>
				</div>				
			</div>
		);
	}
}

export default Header;
